true /// /// ## Example /// //```rust,compile_fail,ignore","breadcrumbs":"TEMPLATE » Template","id":"1","title":"Template"},"10":{"body":"[[ria-pointer]] [[SMARTPOINTER]] What are the differences between references, pointers, and memory addresses? A memory address , often shortened to address, is a number that happens to refer to a single byte in memory . Memory addresses are abstractions provided by assembly languages . >> Used for types where it’s important to make their unsafe nature explicit. A pointer , sometimes expanded to raw pointer, is a memory address that ==points to a value of some type==. Pointers are abstractions provided by higher-level languages . >> Refer to something more primitive . This also includes the implication that we are responsible for maintaining safety. (There is an implied connotation of being unsafe .) A reference is a pointer , or in the case of dynamically sized types , a pointer and an integer with extra guarantees. References are abstractions provided by Rust . >> References—Signal that the Rust compiler will provide its safety guarantees . References always ==refer to valid data==. References are correctly aligned to ==multiples of usize==. Rust ensures that a length is kept alongside the internal pointer . That way Rust can ensure that the program never overruns the type’s space in memory. A reference is like a pointer in that it’s an address we can follow to access data stored at that address that is owned by some other variable. Unlike a pointer, a reference is guaranteed ==to point to a valid value of a particular type==","breadcrumbs":"POINTERS » Reference vs Pointer","id":"10","title":"Reference vs Pointer"},"11":{"body":"In addition, the following tools can also be handy in certain situations: Deeply interlinked data structures can benefit from std::rc::Weak and std::arc::Weak for single and multi-threaded programs, respectively. These allow access to data within an Rc/Arc without incrementing its reference count . This can prevent never-ending cycles of pointers. The alloc::raw_vec::RawVec type underlies Vec and VecDeq. An expandable, double-ended queue that hasn’t appeared in the book so far, it understands how to allocate and deallocate memory in a smart way for any given type. The std::cell::UnsafeCell type sits behind both Cell and RefCell. If you would like to provide interior mutability to your types, its implementation is worth investigating. Memory-Layout-1 Memory-Layout-2 Dynamic Memory","breadcrumbs":"POINTERS » Special pointers","id":"11","title":"Special pointers"},"12":{"body":"Smart-Pointer-1 Smart-Pointer-2 Smart-Pointer-3","breadcrumbs":"POINTERS » Pointer Definations","id":"12","title":"Pointer Definations"},"13":{"body":"","breadcrumbs":"POINTERS » Glossery","id":"13","title":"Glossery"},"14":{"body":"e.q wrapper type. Rust’s smart pointer types tend to wrap raw pointers and bestow them with added semantics.","breadcrumbs":"POINTERS » [[smart_pointer]]","id":"14","title":"[[smart_pointer]]"},"15":{"body":"The term fat pointer refers to memory layout . Thin pointers, such as raw pointers , are a single usize wide . Fat pointers are usually two usize wide,and occasionally more","breadcrumbs":"POINTERS » fat pointer Vs thin pointer","id":"15","title":"fat pointer Vs thin pointer"},"16":{"body":"[[BOX]] [[RC]] Rc enables multiple owners of the same data; Box and RefCell have single owners. Box allows immutable or mutable borrows checked at compile time; Rc allows only immutable borrows checked at compile time; RefCell allows immutable or mutable borrows checked at runtime. Because RefCell allows mutable borrows checked at runtime, you can mutate the value inside the RefCell even when the RefCell is immutable. RefCell lets us have many immutable borrows or one mutable borrow at any point in time. Similar to Rc, RefCell is only for use in [[single_threaded]] scenarios. Neither Cell nor RefCell are thread safe (they do not implement #Sync ) Standard library has other types that provide interior mutability: Such as Cell, which is similar except that instead of giving references to the inner value, the value is copied in and out of the Cell. There’s also Mutex, which offers interior mutability that’s safe to use across threads [[multi_tread]] scenarios.","breadcrumbs":"SMARTPOINTER » Comparistions of Smart pointers [[rust-doc]]","id":"16","title":"Comparistions of Smart pointers [[rust-doc]]"},"17":{"body":"[[ria-smartpointer-box]] [[rust-doc]] [ cons=recursive type We now know that any List value will take up the size of an i32 plus the size of a box’s pointer data. By using a box, we’ve broken the infinite , recursive chain, so the compiler can figure out the size it needs to store a List value . Cons+Box :A List that is not infinitely sized because Cons holds a Box Cons : A List that is infinitely sized because Cons is just a name and it is replacable with anyname. Boxes allow you to store data on the heap rather than the stack. What remains on the stack is the pointer to the heap also don’t have any performance overhead that these special capabilities incur, so they can be useful in cases like the cons list where the indirection is the only feature we need. >>The Box type is a [[smart_pointer]] because it implements the #Deref trait, which allows Box values to be treated like references . When a Box value goes out of scope, the #heap data that the box is pointing to is cleaned up as well because of the #Drop [[trait]] implementation. You’ll use them most often in these situations: When you have a type whose size can’t be known at compile time and you want to use a value of that type in a context that requires an exact size When you have a large amount of data and you want to transfer ownership but ensure the data won’t be copied when you do so When you want to own a value and you care only that it’s a type that implements a particular trait rather than being of a specific type. At [[compile_time]] , Rust needs to know how much space a type takes up. One type whose size can’t be known at compile time is a recursive type , where a value can have as part of itself another value of the same type. Because this nesting of values could theoretically continue infinitely, Rust doesn’t know how much space a value of a recursive type needs. However, boxes have a known size , so by inserting a box in a recursive type definition, you can have recursive types. Box is very useful for returning traits . You also saw that we can use impl Trait to return other traits, or closures. Box can be used in a similar way. You can use a Box because otherwise the compiler won't know the size of the value . [[dyn]] is a word that shows you that you are talking about a trait, not a struct or anything else. ]","breadcrumbs":"BOX","id":"17","title":"BOX"},"2":{"body":"It underpins the term fearless concurrency Borrow checking relies on three interrelated concepts—lifetimes, ownership, and borrowing: Ownership: the notion of ownership is rather limited. An owner cleans up when its values’ lifetimes end. For example, when a function returns, the memory holding its local variables needs to be freed. Owners cannot prevent other parts of the program from accessing their values or report data theft to some overarching Rust authority.==the term move means== something very specific within Rust. Nothing physically moves.Movement within Rust code refers to movement of ownership , rather than the movement of data. Ownership is a term used within the Rust community to refer to the compile-time process that checks that every use of a value is valid and that every value is destroyed cleanly. ownership system provides a route to memory safety without needing a garbage collector. Four general strategies can help with ownership issues: - Use references where full ownership is not required. - Duplicate the value. - Refactor code to reduce the number of long-lived objects. - Wrap your data in a type designed to assist with movement issues. To borrow: ==there is no obligation to return the value to its owner==. Its meaning is used to emphasize that while values can have a single owner , it’s possible for many parts of the program to share access to those values. [[LIFETIME]]","breadcrumbs":"BORROWCHECKER » Glossery","id":"2","title":"Glossery"},"3":{"body":"Ownership has a particular meaning within Rust. An owner is able to make any changes to the data and is responsible for deleting values that it owns when it leaves scope.","breadcrumbs":"BORROWCHECKER » [[Ownership]]","id":"3","title":"[[Ownership]]"},"4":{"body":"ria-commandline","breadcrumbs":"COMMANDLINE","id":"4","title":"COMMANDLINE"},"5":{"body":"[[VECTOR]]","breadcrumbs":"COLLECTION","id":"5","title":"COLLECTION"},"6":{"body":"","breadcrumbs":"DATA » DATA","id":"6","title":"DATA"},"7":{"body":"tags #try_into [[ria-texttoenum]]","breadcrumbs":"DATA » CONVERT","id":"7","title":"DATA"},"8":{"body":"[[rust-in-action/ria-data-file]]","breadcrumbs":"DATA » FILE","id":"8","title":"DATA"},"9":{"body":"tags #parse #enum #log #splitn","breadcrumbs":"DATA » FILE","id":"9","title":"DATA"}},"length":18,"save":true},"fields":["title","body","breadcrumbs"],"index":{"body":{"root":{"1":{"df":3,"docs":{"1":{"tf":1.4142135623730951},"11":{"tf":1.0},"12":{"tf":1.0}}},"2":{"df":2,"docs":{"11":{"tf":1.0},"12":{"tf":1.0}}},"3":{"df":1,"docs":{"12":{"tf":1.0}}},"a":{"b":{"df":0,"docs":{},"s":{"df":0,"docs":{},"t":{"df":0,"docs":{},"r":{"a":{"c":{"df":0,"docs":{},"t":{"df":1,"docs":{"10":{"tf":1.7320508075688772}}}},"df":0,"docs":{}},"df":0,"docs":{}}}}},"c":{"c":{"df":0,"docs":{},"e":{"df":0,"docs":{},"s":{"df":0,"docs":{},"s":{"df":3,"docs":{"10":{"tf":1.0},"11":{"tf":1.0},"2":{"tf":1.4142135623730951}}}}}},"df":0,"docs":{},"t":{"df":0,"docs":{},"i":{"df":0,"docs":{},"o":{"df":0,"docs":{},"n":{"/":{"df":0,"docs":{},"r":{"df":0,"docs":{},"i":{"a":{"df":1,"docs":{"8":{"tf":1.0}}},"df":0,"docs":{}}}},"df":0,"docs":{}}}}}},"d":{"d":{"df":0,"docs":{},"i":{"df":0,"docs"